import React from "react";

export const Tile = (props) => {
  
  const object = props.info;
  const values = Object.values(object)

  const info = values.map((value, index) => {
    let className;
    if (index === 0) {
      className = 'tile-title';
    } else {
      className = 'tile'
    }
    
  })

  return (
    <div className="tile-container">
      
    </div>
  );
};
